import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark background-color: #6B5B95">
      <a className="navbar-brand" href="/">
        React Google Reading List
      </a>
    </nav>
  );
}

export default Nav;
